import csvimport osimport sysos.chdir('/Users/jonathanrocha/Desktop/ClassWork/python-challenge/Resources')# csvpath('/Users/jonathanrocha/Desktop/ClassWork/python-challenge/Resources/budget_data.csv')budgetdata_csv= 'budget_data.csv'sys.stdout=open('/Users/jonathanrocha/Desktop/output-pybank.txt','wt')# establishing variables profitbucket=[]monthsbucket=[]changedifference=[]change=0increaseinmonths=""decreaseinmonths=""decreaseprofit=0increaseprofit=0with open(budgetdata_csv) as csv_file:    reader=csv.reader(csv_file)    heading=next(reader)        for row in reader:                #set values for the buckets        monthsbucket.append(str(row[0]))        profitbucket.append(int(row[1]))                #Collect the totals         totalmonths=len(monthsbucket)        totalcount=sum(profitbucket)            # for loop to gather the changes and use the changes to calculate the average       for i in range(len(profitbucket)):        if i ==0:            change=profitbucket[i]        else:                difference=profitbucket[i]-change                changedifference.append(difference)                change=profitbucket[i]                                monthsused=len(changedifference)                # monthsused - use to check the the right number of months(1 less than the total )                totalsum=sum(changedifference)                # totalsum- use verify the sum                averagechange=totalsum/monthsused                # averagechange- use to verify the right amount is calculated                     # for loop to calculate the increase & decrease with monthsbucket and changeddifference               for i in range(len(changedifference)):        if changedifference[i]>increaseprofit:            increaseprofits=changedifference[i]                        increaseinmonths=monthsbucket[i]                    elif changedifference[i]<decreaseprofit:             decreaseprofit=changedifference[i]             decreaseinmonths=monthsbucket[i]                       print(f'Financial Analysis')print(f'---------------------------')print(f'Total Months: {totalmonths}')print(f'Total: {totalcount}')print(f'Average: ${averagechange}')print(f'Greatest Increase in Profits: {increaseinmonths} (${increaseprofits})')print(f'Greatest Decrease in Profits: {decreaseinmonths} (${decreaseprofit})')                       #################################################################################        import csvimport osimport sysos.chdir('/Users/jonathanrocha/Desktop/ClassWork/python-challenge/Resources')election=('election_data.csv')sys.stdout=open('/Users/jonathanrocha/Desktop/output-pypoll.txt','wt')# established variablescandidateslist={}votes=0with open('election_data.csv')as file:    csv_reader=csv.reader(file)    heading=next(csv_reader)    # for loop to calculate votes     for row in csv_reader:        votes+=1                 candidates=row[2]             if candidates not in candidateslist:            candidateslist[candidates]=1        else:            candidateslist[candidates]+=1      names=list(candidateslist.keys())for candidates, count in candidateslist.items():            x=candidateslist            # use the x as a keyholder            keymax=max(candidateslist, key= lambda x:candidateslist[x])               print(f'Election Results')  print(f'------------------')print(f'Total Votes: {votes}')print(f'------------------')        # break up the print statements for the calculation to work with the for loop#for loop used to bring back candidates, calculate percentages and total votesfor key,value in candidateslist.items():             print(f'{key}: {value/votes*100}% ({value})')               perc=value/votes*100             percprint(f'------------------') print(f'Winner: {keymax}')print(f'------------------')                                                                 